const initialState = {
	settings: {
		is_absences_layer: false,
		is_time_layer: false,
	},
	employee_next_id: 1,
	employees: [],
	schedules: [],
	dates: [],
}

const settingsReducer = ( state = {}, action ) => {
	switch ( action.type ) {
		case 'START': {
			return { ...state }
		}
		default:
			return state
	}
}

export default settingsReducer;
